import "./App.css";

import { BrowserRouter, Router } from "react-router-dom";
import Routers from "./config/Routers";

function App() {
  return (
    <BrowserRouter>
      <Route
        render={() => (
          <div>
            <Routers />
          </div>
        )}
      />
    </BrowserRouter>
  );
}

export default App;
